package de.unidue.ltl.recommender.core;

import static org.apache.uima.fit.factory.CollectionReaderFactory.createReaderDescription;

import java.io.File;
import org.codehaus.plexus.util.Base64;

import org.apache.commons.io.FileUtils;
import org.apache.uima.analysis_engine.AnalysisEngineDescription;
import org.apache.uima.collection.CollectionReaderDescription;
import org.apache.uima.fit.factory.AnalysisEngineFactory;
import org.apache.uima.fit.factory.CollectionReaderFactory;
import org.apache.uima.fit.pipeline.SimplePipeline;
import org.apache.uima.jcas.JCas;
import org.apache.uima.resource.metadata.TypeSystemDescription;
import org.apache.uima.util.TypeSystemUtil;
import org.dkpro.tc.api.features.TcFeatureFactory;
import org.dkpro.tc.features.ngram.WordNGram;
import org.dkpro.tc.ml.builder.ExperimentBuilder;
import org.dkpro.tc.ml.builder.ExperimentType;
import org.dkpro.tc.ml.builder.FeatureMode;
import org.dkpro.tc.ml.builder.LearningMode;
import org.dkpro.tc.ml.builder.MLBackend;
import org.dkpro.tc.ml.libsvm.LibsvmAdapter;
import org.dkpro.tc.ml.uima.TcAnnotator;

import com.google.gson.JsonElement;
import com.google.gson.JsonParser;

import de.tudarmstadt.ukp.dkpro.core.api.segmentation.type.Sentence;
import de.tudarmstadt.ukp.dkpro.core.api.segmentation.type.Token;
import de.tudarmstadt.ukp.dkpro.core.io.bincas.BinaryCasReader;
import de.unidue.ltl.recommender.core.predict.ResultWriterAnnotator;
import de.unidue.ltl.recommender.core.train.TrainingOutcomeAnnotator;
import de.unidue.ltl.recommender.core.util.CoreUtil;

public class RoundTripPrototype
{
    public static void main(String[] args) throws Exception
    {
        
        System.setProperty("DKPRO_HOME", System.getProperty("user.home") + "/Desktop");
        
        File outputDirectory = new File("target/out");
        outputDirectory.mkdirs();

//        String inputCas = "{\"CAS\":\"\",\"Typesystem\":\"\",\"Layer\":\"webanno.custom.EDAktivitt\",\"Target\":\"Typ\"}";
        String inputCas = "";
        JsonElement parse = new JsonParser().parse(inputCas);
        
        File typesystemXML = new File("src/main/resources/typesystem.xml");
        String typeSystemString = new String(Base64.decodeBase64(parse.getAsJsonObject().get("Typesystem").toString().getBytes()));
        FileUtils.writeStringToFile(typesystemXML, typeSystemString, "utf-8");
        
        String featureType = new String(parse.getAsJsonObject().get("Target").toString().getBytes());
        featureType = featureType.substring(1, featureType.length()-1);
        String annotation = parse.getAsJsonObject().get("Layer").toString();
        annotation = annotation.substring(1, annotation.length()-1);
        
        String trainCasString = FileUtils.readFileToString(new File("src/main/resources/casAnnotated.txt"), "utf-8");
        JCas jCasTrain = CoreUtil.deserialize(trainCasString, typesystemXML);
        
        TypeSystemDescription typeSystemDesc = TypeSystemUtil.typeSystem2TypeSystemDescription(jCasTrain.getTypeSystem());
        
        File casTrainOutput = new File("src/main/resources/cas/train/");
        CoreUtil.writeCasBinary(jCasTrain, typeSystemDesc, casTrainOutput);
        
        File model = new File(System.getProperty("user.home")  + "/Desktop/inception-model");
        trainModel(casTrainOutput, typeSystemDesc, model, typesystemXML, annotation, featureType);
        
        String casString = new String(Base64.decodeBase64(parse.getAsJsonObject().get("CAS").toString().getBytes()));
        JCas jCasPrediction= CoreUtil.deserialize(casString, typesystemXML);
        
        File casPredictOutput = new File("src/main/resources/cas/predict/");
        
        CoreUtil.writeCasBinary(jCasPrediction, typeSystemDesc, casPredictOutput);
        predict(casPredictOutput, model, annotation, featureType);

        
    }

    private static void predict(File casPredictOutput, File model, String annotation, String type) throws Exception
    {
        CollectionReaderDescription reader = CollectionReaderFactory.createReaderDescription(
                BinaryCasReader.class,
                BinaryCasReader.PARAM_MERGE_TYPE_SYSTEM, true,
                BinaryCasReader.PARAM_LANGUAGE, "en",
                BinaryCasReader.PARAM_SOURCE_LOCATION, casPredictOutput.getAbsoluteFile(),
                BinaryCasReader.PARAM_PATTERNS, "*.bin");

        AnalysisEngineDescription annotator = AnalysisEngineFactory.createEngineDescription(
                TcAnnotator.class,
                TcAnnotator.PARAM_NAME_SEQUENCE_ANNOTATION, Sentence.class.getName(), 
                TcAnnotator.PARAM_NAME_UNIT_ANNOTATION, Token.class.getName(), 
                TcAnnotator.PARAM_TC_MODEL_LOCATION, model,
                TcAnnotator.PARAM_RETAIN_TARGETS, false);
        
        AnalysisEngineDescription out = AnalysisEngineFactory.createEngineDescription(
                ResultWriterAnnotator.class,
                ResultWriterAnnotator.PARAM_ANNOTATION_TARGET_NAME, annotation, 
                ResultWriterAnnotator.PARAM_ANNOTATION_TARGET_FIELD_NAME, type,
                ResultWriterAnnotator.PARAM_OUTPUT_FOLDER, System.getProperty("user.home")+"/Desktop/");
        
        SimplePipeline.runPipeline(reader, annotator, out);
        
    }

    private static void trainModel(File casOutput, TypeSystemDescription typeSystenDesc, File modelOut, File typesystemXML, String annotation, String featureType) throws Exception
    {
        CollectionReaderDescription trainReader = createReaderDescription(
                BinaryCasReader.class,
                typeSystenDesc,
                BinaryCasReader.PARAM_LANGUAGE, "en", 
                BinaryCasReader.PARAM_SOURCE_LOCATION, casOutput.getAbsolutePath(),
                BinaryCasReader.PARAM_PATTERNS, "*.bin");
        
        ExperimentBuilder builder = new ExperimentBuilder();
        builder.experiment(ExperimentType.SAVE_MODEL, "Inception")
               .dataReaderTrain(trainReader)
               .featureMode(FeatureMode.UNIT)
               .learningMode(LearningMode.SINGLE_LABEL)
               .outputFolder(modelOut.getAbsolutePath())
               .machineLearningBackend(new MLBackend(new LibsvmAdapter(), "-c", "100"))
               .preprocessing(AnalysisEngineFactory.createEngineDescription(TrainingOutcomeAnnotator.class,
                        TrainingOutcomeAnnotator.PARAM_ANNOTATION_TARGET_NAME, annotation,
                        TrainingOutcomeAnnotator.PARAM_ANNOTATION_TARGET_FIELD_NAME, featureType))
               .features(TcFeatureFactory.create(WordNGram.class, 
                                                 WordNGram.PARAM_NGRAM_MIN_N, 1, 
                                                 WordNGram.PARAM_NGRAM_MAX_N, 4, 
                                                 WordNGram.PARAM_NGRAM_USE_TOP_K, 2000))
               .run();
               
    }


    
}
